import React from 'react';
import ListeVideo from './ListeVideo';

const Notifications = ({ selectedClub }) => {
  return (
    <div>
      <h1>Notifications</h1>
      <ListeVideo selectedClub={selectedClub} />
    </div>
  );
};

export default Notifications;
